import React from "react"
import "./Search.css"
import "bootstrap/dist/css/bootstrap.min.css"
import Button from 'react-bootstrap/Button'

const search = props => {
  const {  nominate, disable, nominated, } = props;
  return (
    <div >
    <Button variant="warning" className = "nominate" onClick = {nominate} disabled = {disable || nominated}>Nominate</Button>
    </div>
  )
}

export default search
